import React from 'react';
import img_logo from './img/motionvalue_logo.png';
import './Home.css';


const Home = () => {
    return (        
        <div className="Home">
            <header className='Home-header'>            
                < img src={img_logo} className="Home-image"/>                    
            </header>
        </div>
    );
};

export default Home;
